[{'comment_id': 957524175, 'comment_body': '```suggestion
    printk("%0.2f",d);
```

I think [according to the Arduino reference](https://www.arduino.cc/reference/en/language/functions/communication/serial/print/) the default floating point precision is 2 decimal places.

Also, we should have the same function but for `float` type parameters.', 'comment_created': datetime.datetime(2022, 8, 29, 16, 2, 13, tzinfo=datetime.timezone.utc), 'commenter': 'szczys', 'type': 'User'}, {'comment_id': 957530500, 'comment_body': "Is `%x` the formatter for octal? It would be `%o` for `printf`, but [I don't know if you can use that for `printk`](https://docs.zephyrproject.org/apidoc/latest/printk_8h.html#a768a7dff8592b69f327a08f96b00fa54).", 'comment_created': datetime.datetime(2022, 8, 29, 16, 6, 48, tzinfo=datetime.timezone.utc), 'commenter': 'szczys', 'type': 'User'}, {'comment_id': 957535617, 'comment_body': 'This [should return](https://www.arduino.cc/reference/en/language/functions/communication/serial/print/#_returns) the number of bytes written. In this function, each conversion might use the following to do the actual printing:
```
char buffer[SOME_BUFFER_SIZE];
snprintk(buffer, sizeof(buffer), "%x", value);
printk("%s", buffer)
```

Then at the end of the function:

```
return strlen(buffer);
```', 'comment_created': datetime.datetime(2022, 8, 29, 16, 11, 48, tzinfo=datetime.timezone.utc), 'commenter': 'szczys', 'type': 'User'}, {'comment_id': 957541035, 'comment_body': 'You may consider implementing a `size_t arduino::ZephyrSerial::print(double d, const int precision )` precision function and calling that from this function with `2` as the precision. You can do an `snprintk` with the precision as a variable in order to create the format string passed to the `printk` statement:

```
snprintk(buffer, sizeof(buffer), "\%0.%df", precision);
printk(buffer, d);
```', 'comment_created': datetime.datetime(2022, 8, 29, 16, 17, 7, tzinfo=datetime.timezone.utc), 'commenter': 'szczys', 'type': 'User'}]
